import React from 'react';

export default function Navbar() {
	return (
		<div className="h-20 bg-slate-900 font-medium text-white text-center leading-[4rem] text-3xl">
			Music Reactjs
			<p>
				Trần Tấn Tài | Nguyễn Thành Vinh | Nguyễn Văn Hậu
			</p>
		</div>
	);
}
